void gymnistmassmat(double mmat[54][54])
{
/* Calculate the system mass matrix
*/
    int i,j;
    double udotin[54],mmrow[54],biastrq[54];

    if ((roustate != 2) && (roustate != 3)) {
        gymnistseterr(57,23);
        return;
    }
    for (i = 0; i < 54; i++) {
        udotin[i] = 0.;
    }
    gymnistcomptrq(udotin,biastrq);
    for (i = 0; i < 54; i++) {
        udotin[i] = 1.;
        gymnistcomptrq(udotin,mmrow);
        udotin[i] = 0.;
        for (j = i; j <= 53; j++) {
            mmat[i][j] = mmrow[j]-biastrq[j];
            mmat[j][i] = mmat[i][j];
        }
    }
/*
Check for singular mass matrix
*/
    for (i = 0; i < 54; i++) {
        if (mmat[i][i] <= 1e-13) {
            gymnistseterr(57,47);
        }
    }
}

void gymnistfrcmat(double fmat[54])
{
/* Return the system force matrix (RHS), excluding constraints
*/
    int i;

    if ((roustate != 2) && (roustate != 3)) {
        gymnistseterr(58,23);
        return;
    }
    gymnistdofs0();
    for (i = 0; i < 54; i++) {
        fmat[i] = fs0[i];
    }
}

